import {BrowserRouter} from 'react-router-dom'; 
import Navbar from './components/layout/Navbar.js'
import SignedInLinks from './components/layout/SignInLinks'

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        {/* <Navbar /> */}
        <SignedInLinks />
        <h1>Mario plan</h1>
      </div>
    </BrowserRouter>
  );
}

export default App;
